import React from "react";
import { useState } from "react";
import moon from "../../images/moon.png";

const Skills = () => {
  const [moon, setMoon] = useState({ left: 10, top: 28 });

  const moonHandler = () => {
    let newMoon = {...moon};
    // const beep = moon.left + 1
    // console.log(beep);
    newMoon.left = moon.left + 20
    newMoon.top = moon.top + 10
    console.log(newMoon);
    setMoon(newMoon)
  };

  return (
    <div className="h-screen grid grid-cols-[1fr_2fr] px-20 mt-40 ">
      <div className="flex justify-center ">
        <div
          className={`absolute w-40 h-40 bg-moonlight rounded-full -ml-${moon.left} -mt-${moon.top} `}
        />
        <div className=" w-40 h-40 bg-white rounded-full" />
      </div>
      <div className="">
        <div className="">
          <h2 className="text-2xl ml-40 w-100 text-right border-b border-white leading-4 mb-10 h-2">
            <span className="bg-darkblue pl-4">SKILLS</span>
          </h2>
        </div>
        <div className="flex gap-3 flex-wrap justify-end z-10">
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Bootstrap
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            CSS Tailwind
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            React
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            HTML
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Material UI
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Node.js
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Next.js
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            React
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            HTML
          </button>
          <button
            onClick={moonHandler}
            className="rounded-full bg-orange-500 py-1.5 px-5 outline hover:bg-orange-400"
          >
            Node.js
          </button>
        </div>
      </div>
    </div>
  );
};

export default Skills;
